    <div {...{
      "className": "admonition admonition-note alert alert--secondary"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M6.3 5.69a.942.942 0 0 1-.28-.7c0-.28.09-.52.28-.7.19-.18.42-.28.7-.28.28 0 .52.09.7.28.18.19.28.42.28.7 0 .28-.09.52-.28.7a1 1 0 0 1-.7.3c-.28 0-.52-.11-.7-.3zM8 7.99c-.02-.25-.11-.48-.31-.69-.2-.19-.42-.3-.69-.31H6c-.27.02-.48.13-.69.31-.2.2-.3.44-.31.69h1v3c.02.27.11.5.31.69.2.2.42.31.69.31h1c.27 0 .48-.11.69-.31.2-.19.3-.42.31-.69H8V7.98v.01zM7 2.3c-3.14 0-5.7 2.54-5.7 5.68 0 3.14 2.56 5.7 5.7 5.7s5.7-2.55 5.7-5.7c0-3.15-2.56-5.69-5.7-5.69v.01zM7 .98c3.86 0 7 3.14 7 7s-3.14 7-7 7-7-3.12-7-7 3.14-7 7-7z"
              }}></path></svg></span>{`Public Preview`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`LiveData Migrator is in public preview. This gives you access to all product functionality for review, but limits operation time to 10 minutes during the preview period.`}</p></div></div>
    <p>{`Get started with data migration in less than 30 seconds. If you're new to the concept of LiveData, or want to know what LiveData Migrator does, please read the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/"
      }}>{`introduction to LiveData Migrator`}</a>{`.`}</p>
    <div class="download">
      <a href="https://customer.wandisco.com">Download LiveData Migrator</a>
    </div>
    <p>{`Migrate your data immediately in three steps:`}</p>
    <ol>
      <li parentName="ol">{`Run LiveData Migrator,`}</li>
      <li parentName="ol">{`Define a target, then`}</li>
      <li parentName="ol">{`Migrate your data.`}</li>
    </ol>
    <h2 {...{
      "id": "1-run-livedata-migrator"
    }}>{`1. Run LiveData Migrator`}</h2>
    <p>{`As the `}<inlineCode parentName="p">{`hdfs`}</inlineCode>{` user on a cluster edge node:`}</p>
    <pre><code parentName="pre" {...{}}>{`$ hadoop jar live-migrator.jar
`}</code></pre>
    <p>{`For more details, see the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/getting-started#running-livedata-migrator"
      }}>{`Getting Started`}</a>{` guide.`}</p>
    <h2 {...{
      "id": "2-define-your-target"
    }}>{`2. Define your target`}</h2>
    <p>{`Define a reference to your target file system with `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/command-reference#file-system-commands"
      }}><inlineCode parentName="a">{`filesystem add`}</inlineCode></a>{` before migrating data to it. e.g.`}</p>
    <pre><code parentName="pre" {...{}}>{`WANdisco LiveMigrator >> filesystem add adls2 sharedKey --file-system-id mytarget --storage-account-name psmadls2 --container.name lm2target --fs.azure.shared.key Ri5NxHGqoQ79DBGLVn+COK/sRDwbNqAREDACTEDaMxRkvXt2ijUtAkVqVCBj/vaS/NbzR5rtjE2CZ31ejVpUVA==
{
  "fsId" : "lm2target",
  "fsType" : "adls2-hcfs",
  "isSource" : false,
  "properties" : {
    "fsId" : "lm2target",
    "fsType" : "adls2-hcfs",
    "fs.defaultFS" : "abfss://lm2target@psmadls2.dfs.core.windows.net/",
    "fs.azure.account.auth.type.psmadls2.dfs.core.windows.net" : "SharedKey",
    "fs.azure.account.key.psmadls2.dfs.core.windows.net" : "Ri5NxHGqoQ79DBGLVn+COK/sRDwbNqAREDACTEDaMxRkvXt2ijUtAkVqVCBj/vaS/NbzR5rtjE2CZ31ejVpUVA==",
    "fs.abfss.impl" : "org.apache.hadoop.fs.azurebfs.SecureAzureBlobFileSystem",
    "fs.AbstractFileSystem.abfss.impl" : "org.apache.hadoop.fs.azurebfs.Abfss",
    "fs.abfss.impl.disable.cache" : "true"
  },
  "eventsPosition" : 0
}
`}</code></pre>
    <h2 {...{
      "id": "3-migrate-your-data"
    }}>{`3. Migrate your data`}</h2>
    <p>{`Create and auto-start the migration for a directory in your source, like `}<inlineCode parentName="p">{`/repl1`}</inlineCode>{`, to the target you created with the identifier `}<inlineCode parentName="p">{`lm2target`}</inlineCode>{` using `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/command-reference#migration-new"
      }}><inlineCode parentName="a">{`migration new`}</inlineCode></a>{`. e.g.`}</p>
    <pre><code parentName="pre" {...{}}>{`WANdisco LiveMigrator >> migration new --auto-start --path /repl1 --target lm2target
{
  "migrationId" : "343a270e319d5beb0bf1adfbb1a5d0f8f3c0a4d6",
  "path" : "/repl1",
  "source" : "auto-discovered-source-hdfs",
  "target" : "lm2target",
  "state" : "SCHEDULED",
  "exclusions" : [ ],
  "migrationStartTime" : "2020-06-03T05:17:27.936+0000",
  "migrationEdge" : "/repl1",
  "scannerSummary" : {
    "progressSummary" : {
      "filesScanned" : 0,
      "directoriesScanned" : 0,
      "bytesScanned" : 0
    },
    "contentSummary" : null
  },
  "migrationCompleteTime" : null,
  "abortReason" : null,
  "filesSeen" : 0,
  "dirsSeen" : 0,
  "sizeOfMigration" : 0
}
`}</code></pre>
    <p>{`Use `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/command-reference#status"
      }}><inlineCode parentName="a">{`status`}</inlineCode></a>{` for information about the progress of migrations that are underway, as well as those that are Live, meaning that they have migrated all pre-existing data and are keeping the target file system consistent with new data and other changes made to the source.`}</p>
    <pre><code parentName="pre" {...{}}>{`WANdisco LiveMigrator >> status

Total Migrations:  1
Average Bandwidth: 0.00 Gb/s, 0.00 Gb/s, 0.00 Gb/s
Peak Bandwidth:    0.00 Gb/s
Average Files/s:   0, 0, 0
Peak Files/s:      0

Live: 1
     /repl1 343a270e319d5beb0bf1adfbb1a5d0f8f3c0a4d6

Running: 0

Ready: 0
`}</code></pre>
    <p>{`Monitor the operation of LiveData Migrator, including the average bandwidth used in the last 10 second, 1 minute, and 5 minute intervals. If you need more specific information about an individual migration, you can view details for it with `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/command-reference#migration-show"
      }}><inlineCode parentName="a">{`migration show`}</inlineCode></a>{`.`}</p>
    <h1 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h1>
    <p>{`For a more comprehensive introduction to using LiveData Migrator, including installation, operation and the full set of commands, please read the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/getting-started"
      }}>{`Getting Started`}</a>{` guide.`}</p>
    </MDXLayout>;
}

;
